                class Playlist {
                    // Attibutes
                    private $name;
                    private $album = array();
                    private $artist = array();
                    private $cover = array();
                    private $year = array();
                    //Methods

                    public function __construct($name){
                        $this->name = $name;

                    }

                    public function setPlaylist($album,$artist,$cover,$year){
                        $this->album[] = $album;
                        $this->artist[] = $artist;
                        $this->cover[] = $cover;
                        $this->year[] = $year;
                    }

                    public function getPlaylist(){
                        echo "<div class='p-4 border-2 ring-white/50 rounded-lg w-[300px] m-4 '>
                                <h2 class='text-center uppercase font-bold'>
                                    Playlist: $this->name
                                </h2>";
                            for($i = 0; $i <count($this->artist); $i++){
                                echo "<div class='bg-white/30  w-[250px] flex flex-col justify-center items-center text-center m-4 rounded-[10px] p-4'>
                                <img class='rounded-lg w-[150px] h-[150px]' src='".$this->cover[$i]."' alt='Album cover'>
                                <p class='text-black'><strong>Name Album:</strong>".$this->album[$i]."</p>
                                <p class='text-black'><strong>Artist:</strong> ".$this->artist[$i]."</p>
                                <p class='text-black'><strong>Year:</strong> ".$this->year[$i]." </p>
                                </div> ";
                            }    

                        echo "</div>";
                    }
                }

                $mymusic = new Playlist('Vallenaticos');
                $mymusic->setPlaylist('Black Charrito','Despeching','https://i.scdn.co/image/ab6761610000e5eb4d2107c9fb0ecbb7341683e8','2008');
