                $mymusic->setPlaylist('Los inquietos del vallenato','Despeching','data:image/jpeg;base64,','1950');
                $mymusic->setPlaylist('Binomio de oro','Despeching','data:image/jpeg;base64,','1980');
                $mymusic->setPlaylist('Los chices vallenatos','Despeching','data:image/jpeg;base64,','1990');
                $mymusic->getPlaylist();

